import React from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, ResponsiveContainer } from 'recharts';
import { TrendingUp, TrendingDown, Wallet, PieChart } from 'lucide-react';
import { mockUser, mockPortfolioData, mockHoldings } from '../utils/mockData';

const Dashboard = () => {
  const { walletBalance, totalInvested, currentValue, totalGain, gainPercentage } = mockUser;

  const StatCard = ({ title, value, change, changeType, icon: Icon }) => (
    <div className="card">
      <div className="flex items-center justify-between">
        <div>
          <p className="text-sm font-medium text-gray-600">{title}</p>
          <p className="text-2xl font-bold text-gray-900">â‚¹{value.toLocaleString()}</p>
          {change && (
            <div className={`flex items-center mt-1 ${changeType === 'positive' ? 'text-success-600' : 'text-danger-600'}`}>
              {changeType === 'positive' ? <TrendingUp className="h-4 w-4 mr-1" /> : <TrendingDown className="h-4 w-4 mr-1" />}
              <span className="text-sm font-medium">â‚¹{Math.abs(change).toLocaleString()} ({Math.abs(gainPercentage)}%)</span>
            </div>
          )}
        </div>
        <div className="p-3 bg-primary-50 rounded-full">
          <Icon className="h-6 w-6 text-primary-600" />
        </div>
      </div>
    </div>
  );

  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Dashboard</h1>
        <p className="text-gray-600">Welcome back! Here's your portfolio overview.</p>
      </div>

      {/* Stats Cards */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        <StatCard
          title="Wallet Balance"
          value={walletBalance}
          icon={Wallet}
        />
        <StatCard
          title="Total Invested"
          value={totalInvested}
          icon={PieChart}
        />
        <StatCard
          title="Current Value"
          value={currentValue}
          change={totalGain}
          changeType={totalGain > 0 ? 'positive' : 'negative'}
          icon={TrendingUp}
        />
        <StatCard
          title="Total Returns"
          value={totalGain}
          change={totalGain}
          changeType={totalGain > 0 ? 'positive' : 'negative'}
          icon={totalGain > 0 ? TrendingUp : TrendingDown}
        />
      </div>

      {/* Portfolio Growth Chart */}
      <div className="card">
        <div className="mb-6">
          <h2 className="text-lg font-semibold text-gray-900">Portfolio Growth</h2>
          <p className="text-gray-600">Track your investment performance over time</p>
        </div>
        <div className="h-80">
          <ResponsiveContainer width="100%" height="100%">
            <LineChart data={mockPortfolioData}>
              <CartesianGrid strokeDasharray="3 3" />
              <XAxis dataKey="date" />
              <YAxis />
              <Tooltip formatter={(value) => [`â‚¹${value.toLocaleString()}`, 'Portfolio Value']} />
              <Line 
                type="monotone" 
                dataKey="value" 
                stroke="#2563eb" 
                strokeWidth={2}
                dot={{ fill: '#2563eb', strokeWidth: 2, r: 4 }}
              />
            </LineChart>
          </ResponsiveContainer>
        </div>
      </div>

      {/* Recent Holdings */}
      <div className="card">
        <div className="flex items-center justify-between mb-6">
          <div>
            <h2 className="text-lg font-semibold text-gray-900">Top Holdings</h2>
            <p className="text-gray-600">Your best performing investments</p>
          </div>
          <button className="text-primary-600 hover:text-primary-700 font-medium">View All</button>
        </div>
        <div className="space-y-4">
          {mockHoldings.slice(0, 3).map((holding) => (
            <div key={holding.id} className="flex items-center justify-between p-4 bg-gray-50 rounded-lg">
              <div className="flex items-center space-x-4">
                <div className="w-10 h-10 bg-primary-100 rounded-full flex items-center justify-center">
                  <span className="text-primary-600 font-semibold text-sm">
                    {holding.symbol.substring(0, 2)}
                  </span>
                </div>
                <div>
                  <p className="font-medium text-gray-900">{holding.symbol}</p>
                  <p className="text-sm text-gray-600">{holding.quantity} shares</p>
                </div>
              </div>
              <div className="text-right">
                <p className="font-medium text-gray-900">â‚¹{holding.currentPrice}</p>
                <p className={`text-sm ${holding.pnl > 0 ? 'text-success-600' : 'text-danger-600'}`}>
                  {holding.pnl > 0 ? '+' : ''}â‚¹{holding.pnl} ({holding.pnlPercentage}%)
                </p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
